const storeWrong = (states) => {
  const questionsFromStorage = localStorage.getItem('qInfo')
    ? JSON.parse(localStorage.getItem('qInfo'))
    : []
  for (let i = 0; i < 5; i++) {
    if (questionsFromStorage[i].answer === states[i]) {
      console.log(`Answer # ${i} is correct`)
    } else {
      console.log(`Answer # ${i} is wrong`)
    }
  }
  console.log(questionsFromStorage)
  console.log(states)

  return false
}

export default storeWrong
